class CRASPECT extends Rule {
  constructor(ids) {
    super(ids, S(capture("sub"), VP_(VP(HAVE(), VP(capture("verb"))))));
  }
  apply({sub, verb}, node) {
    let stat = (verb.types || {}).stat;
    
    if (!stat) {
      return [[], [], [], []];
    }
    
    child(node, 1).children[0] = child(node, 1, 0, 1);
    
    if (stat == "-") {
      return [[], [], [], []];
    } else if (stat == "+") {
      return [[], [], [], []];
    }
  }
}

